import React from "react";
import { Grid } from "@material-ui/core";
import RightPane from "./RightPane";

export default props => (
  <Grid
    container={true}
    justify="center"
    classes={{ container: styles.gridBody }}
  >
    <Grid item xs={12} sm={6}>
      <RightPane />
    </Grid>
  </Grid>
);
